import React from 'react';
import {
  IonList, IonItem, IonLabel, IonInput, IonToggle, IonRadio, IonCheckbox, IonItemSliding, IonHeader,
  IonItemOption, IonItemOptions, IonContent, IonPage
} from '@ionic/react';
import ChatItem from "../components/ChatItem";
import AllUsers from '../AllUsers';


function Tab2() {

  alert(AllUsers[0]);
  return (
    <IonPage>
      <IonHeader>Ass</IonHeader>
      <IonContent >

        {/*-- List of Text Items --*/}
        <IonList>
          {
            AllUsers.map((user) => { <ChatItem contact={user} /> })}

        </IonList>



        {/*-- List of Sliding Items --*/}

      </IonContent>
    </IonPage>)
};
export default Tab2;
